<p>Що стосується трансмісії, то у Деу Нексія з нею особливих проблем не спостерігається. Зі слабких місць — куліса, яка розбивається і передачі починають включатися нечітко. Заміна масла в КПП проводиться за регламентом на тисяч.</p><a id='z1'></a><h3>Кому підійде Daewoo Nexia</h3><p>Рекомендується взимку використовувати SAEW75W Зчеплення в коробці здатне витримати ресурс в 80 тис. км, Шруси — близько 50 тисяч. Ходова частина Деу Нексія не є її сильною стороною. Найпроблемнішим місцем вважаються штатні пружини, а особливо-задні. Вже на 50 тисячах вони просто можуть лопнути.</p>
<p>І якщо їх своєчасно не замінити, то ремонт обійдеться набагато дорожче. Кульові опори і амортизатори витримують наші дороги трохи довше. Вони здатні пройти без заміни 60 км. І якщо для кульових це цілком нормальний показник, то стійки бажано ставити відразу не оригінальні, а щось надійніше аналогів. А ось такий же ресурс для передніх гальмівних колодок — це цілком хороший показник. Задні в барабанних гальмах вибігають взагалі в два рази більше. Окремо варто відзначити не дуже надійне електрообладнання.</p>
<p>Причому це стосується практично всього: датчики, панель приладів, високовольтні дроти і так далі. Сама проводка не витримує експлуатацію у важких умовах. Окислюються контакти, обсипається ізолюючий шар. Причини може бути три: Окислення контактів на роз'ємі під водійським сидінням; Несправність контролера не бачить датчика положення распредвала ; Бензин низької якості. Як правило, інших проблем не зустрічається. Кому підійде Daewoo Nexia Цей автомобіль не можна назвати ні красивим — ні сучасним. І Nexia цілком виправдовує ці очікування: Низька початкова вартість Мала витрата палива Великий вибір запчастин за низькими цінами Простота конструкції і хороша ремонтопридатність.</p>
<p>Зате вони більш вигідні, ніж дискові по ряду причин, включаючи підвищену стійкість до сильної запиленості і бруду Daewoo Nexia повністю відповідають її титулу компактного сімейного седана, і вже ніяк не спортивного боліда. Деу Нексія — дивовижний надійний старожил Свій початок автомобіль бере ще з далеких вісімдесятих років, коли в му був проданий перший Опель Кадет-Е. Каталог Daewoo Nexia N та N в інтернет магазині Zaz-shop. Чому ми: відправка товару зі складу доставка по всій країні допоможемо підібрати потрібну запчастину на Нексію каталог з можливістю вибору потрібної деталі турбота про кожного клієнта можливість обміну або поверення товару Можливості автомобіля Деу Нексія Навіть зорове знайомство з моделлю дозволяє зрозуміти, що авто має високу якість виконання, фарбування і підгонки всіх деталей.</p>
