<p>Білогір'я Віньківці Волочиськ Деражня Дунаївці Ізяслав Кам'янець-Подільський Красилів Летичів Нетішин Нова Ушиця Полонне Славута Стара Синява Старокостянтинів Теофіполь Хмельницький Чемерівці Шепетівка Ярмолинці. Ватутіне Городище Драбів Жашків Звенигородка Золотоноша Кам'янка Канів Катеринопіль Корсунь-Шевченківський Лисянка Маньківка Монастирище Сміла Тальне Умань Христинівка Черкаси Чорнобай Чигирин Шпола.</p><strong><a id='z4'></a><h2>9_um_k_2017</h2></strong><p>Сьогодні в пошуках місцезнаходження цієї річки думки вчених розділилися. Одні вважають, що це сучасна р. Солона, що тече в ме-жах Межівського району Дніпропетровської області та впадає у р. Вовчу, притоку Самари. До речі, на Дніпропетровщині протікать три річки з такою назвою. Але була ще одна Сальниця-річка, що впадала в Сіверський Донець, протікала біля міста Ізюм Харківської області та нині не існує, саме в ній багато вчених бачать літописну річку.</p><strong><a id='z5'></a><h2>Запчастини Нексія</h2></strong><p>ходив Володимир Мо-номах. Можливо, що ця застава була збудована на кордоні Київської держави з Диким полем, щоб своєчасно сповіщати про напад кочових половецьких орд. Точне місцезнаход-ження цієї застави невідомо, але народна назва лісу біля м. відбулася відома битва між князями на чолі зі Святославом Всеволодовичем та Рюриком Ростиславичем й полов-цями в гирлі Орілі, поруч із сучасним Дніпропетровськом, в якому кочовики були вщент розгромлені.</p>
<p>Похід же самого кня-зя Ігоря — героя цієї історичної поеми, відбувся у наступному р. Через три роки, зимою р. Полонені повідомили, що головні сили половців знахо-дяться біля Голубого лісу, при впадінні річки Вовчої до Самари. Але похід було припинено через великі сніги. Взагалі кочове населення українського степу у середні віки не було лише ворогом Київської Русі. Повного відриву степу та його населення від життя Київської держави того часу не було й не могло бути.</p>
</p>
